// src/KullaniciDashboard.js
import React from 'react';

function KullaniciDashboard() {
  return (
    <div>
      <h1>Kullanıcı Paneli</h1>
      <p>Burada personel işlemleri yapılacak.</p>
    </div>
  );
}

export default KullaniciDashboard;
